import { useState } from "react";
import NewTodos from "./components/NewTodo";
import Todos from "./components/Todos";
import Todo from "./models/todo";

function App() {
  const [todos, setTodos] = useState([
    new Todo("React"),
    new Todo("TypeScript"),
  ]);
  return (
    <div>
      <NewTodos setTodos={setTodos} />
      <Todos items={todos} />
    </div>
  );
}

export default App;
